import React, { useState } from 'react';
import axios from 'axios';

const CourseCreationTester = () => {
    const [baseUrl, setBaseUrl] = useState('http://localhost:5001');
    const [endpoint, setEndpoint] = useState('/api/courses');
    const [result, setResult] = useState(null);
    const [error, setError] = useState(null);
    const [loading, setLoading] = useState(false);

    const testCourseCreation = async () => {
        setLoading(true);
        setResult(null);
        setError(null);

        const testCourse = {
            courseName: 'Test Course ' + new Date().toISOString(),
            courseCode: 'TEST' + Math.floor(Math.random() * 1000),
            description: 'This is a test course created by the CourseCreationTester',
            department: 'Test Department',
            level: 1
        };

        try {
            const token = localStorage.getItem('token');
            const url = `${baseUrl}${endpoint}`;

            console.log(`Testing course creation at: ${url}`);
            console.log('Test course data:', testCourse);

            const response = await axios.post(url, testCourse, {
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': token ? `Bearer ${token}` : ''
                },
                timeout: 10000 // 10 second timeout
            });

            setResult({
                status: response.status,
                statusText: response.statusText,
                data: response.data
            });

            console.log('Course creation test successful:', response.data);
        } catch (err) {
            console.error('Course creation test failed:', err);

            setError({
                message: err.message,
                response: err.response ? {
                    status: err.response.status,
                    statusText: err.response.statusText,
                    data: err.response.data
                } : null
            });
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="course-creation-tester">
            <h3>Course Creation Tester</h3>

            <div className="form-group">
                <label>Base URL:</label>
                <input 
                    type="text" 
                    value={baseUrl} 
                    onChange={(e) => setBaseUrl(e.target.value)}
                />
            </div>

            <div className="form-group">
                <label>Endpoint:</label>
                <input 
                    type="text" 
                    value={endpoint} 
                    onChange={(e) => setEndpoint(e.target.value)}
                />
            </div>

            <button onClick={testCourseCreation} disabled={loading}>
                {loading ? 'Testing...' : 'Test Course Creation'}
            </button>

            {result && (
                <div className="result success">
                    <h4>Success: {result.status} {result.statusText}</h4>
                    <p>The course was created successfully at: {baseUrl}{endpoint}</p>
                    <pre>{JSON.stringify(result.data, null, 2)}</pre>
                </div>
            )}

            {error && (
                <div className="result error">
                    <h4>Error: {error.message}</h4>
                    {error.response && (
                        <>
                            <p>Status: {error.response.status} {error.response.statusText}</p>
                            <pre>{JSON.stringify(error.response.data, null, 2)}</pre>
                        </>
                    )}
                </div>
            )}

            <style jsx>{`
                .course-creation-tester {
                    margin: 20px;
                    padding: 15px;
                    border: 1px solid #ddd;
                    border-radius: 5px;
                    background-color: #f9f9f9;
                }
                .form-group {
                    margin-bottom: 10px;
                }
                label {
                    display: block;
                    margin-bottom: 5px;
                    font-weight: bold;
                }
                input {
                    width: 100%;
                    padding: 8px;
                    border: 1px solid #ddd;
                    border-radius: 4px;
                }
                button {
                    background-color: #4CAF50;
                    color: white;
                    padding: 10px 15px;
                    border: none;
                    border-radius: 4px;
                    cursor: pointer;
                    margin-top: 10px;
                }
                button:disabled {
                    background-color: #cccccc;
                }
                .result {
                    margin-top: 20px;
                    padding: 10px;
                    border-radius: 4px;
                }
                .success {
                    background-color: #e7f3e8;
                    border: 1px solid #c3e6cb;
                }
                .error {
                    background-color: #f8d7da;
                    border: 1px solid #f5c6cb;
                }
                pre {
                    background-color: #f5f5f5;
                    padding: 10px;
                    border-radius: 4px;
                    overflow-x: auto;
                }
            `}</style>
        </div>
    );
};

export default CourseCreationTester;
